import pytest
from typing import List
class Solution:

    def increasingTriplet(self, nums: List[int]) -> bool:
        first = second = 2**31 - 1

        if len(nums) < 3:
            return False
        
        for n in nums:
            # scan for a small first number, 
            # if it's smaller than a previous known one, 
            # then it's universally better then the old one
            if n <= first:
                first = n
            elif n <= second:
                # this is larger than the first, but still smaller than the second
                # we want the smalled middle possible to support the smallest last possible
                second = n
            else:
                # we found something that was larger than first and second, Success!
                return True
    
        return False

# pytest cases for increasingTriplet
def test_increasingTriplet_with_triplet():
    sol = Solution()
    assert sol.increasingTriplet([1, 2, 3, 4, 5]) == True, "Failed to identify an increasing triplet"

def test_increasingTriplet_without_triplet():
    sol = Solution()
    assert sol.increasingTriplet([5, 4, 3, 2, 1]) == False, "Incorrectly identified an increasing triplet"

def test_increasingTriplet_decreasing_numbers():
    sol = Solution()
    assert sol.increasingTriplet([10, 9, 8, 7, 6]) == False, "Incorrectly identified an increasing triplet in decreasing numbers"

def test_increasingTriplet_equal_numbers():
    sol = Solution()
    assert sol.increasingTriplet([3, 3, 3, 3, 3]) == False, "Incorrectly identified an increasing triplet in equal numbers"

def test_increasingTriplet_empty_list():
    sol = Solution()
    assert sol.increasingTriplet([]) == False, "Incorrectly identified an increasing triplet in an empty list"

def test_increasingTriplet_minimum_length():
    sol = Solution()
    assert sol.increasingTriplet([1, 2, 3]) == True, "Failed to identify an increasing triplet in a minimum length list"

def test_bigNums():
    sol = Solution()
    assert sol.increasingTriplet([4,5,2147483647,1,2]) == True, "Failed to identify an increasing triplet in a list of big numbers"

def test_someNegatives():
    sol = Solution()
    assert sol.increasingTriplet([2,4,-2,-3]) == False, "Incorrectly identified an increasing triplet in a list with some negatives"

def test_upDown():
    sol = Solution()
    assert sol.increasingTriplet([1,2,2,1]) == False, "Incorrectly identified  an increasing triplet in a list going up and down"

def test_internalSpanNums():
    sol = Solution()
    assert sol.increasingTriplet([4,2147483647,0,1,2,3]) == True, "Failed to identify an increasing triplet in an internal span"

